import React from 'react'

const ProductList = ({products}) => {
   
  return (
    <div className=''>
        {
    products.map((items,index)=>{
       return(
             <div>
               <img src={items.url} alt="" />
             </div>
    )})
        }
    </div>
  )
}

export default ProductList
